css:
:host,
atom-text-editor {
  background-color: #151515;
  color: #e8e8d3;
}
:host,
atom-text-editor {
  background-color: #151515;
  color: #e8e8d3;
}
:host .wrap-guide,
atom-text-editor .wrap-guide {
  background-color: #2f2f2f;
}
:host .indent-guide,
atom-text-editor .indent-guide {
  color: #9098a0;
}
:host .invisible-character,
atom-text-editor .invisible-character {
  color: #b0b8c0;
}
:host .gutter,
atom-text-editor .gutter {
  background-color: #9098a0;
  color: #f0f0f0;
}
:host .gutter .line-number.cursor-line,
atom-text-editor .gutter .line-number.cursor-line {
  background-color: #b0b8c0;
  color: #f0f0f0;
}
:host .gutter .line-number.cursor-line-no-selection,
atom-text-editor .gutter .line-number.cursor-line-no-selection {
  color: #f0f0f0;
}
.gutter .line-number.folded,
.gutter .line-number:after,
.fold-marker:after {
  color: #ccc5c4;
}
.invisible {
  color: #e8e8d3;
}
.cursor {
  color: #b0d0f0;
  background-color: #b0d0f0;
}
.selection .region {
  background-color: #404040;
}
atom-text-editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #ccc5c4;
}
atom-text-editor .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #888888;
}
.entity.name.type {
  color: #f0c674;
}
.entity.other.inherited-class {
  color: #99ad6a;
}
.keyword {
  color: #447799;
}
.keyword.control {
  color: #447799;
}
.keyword.operator {
  color: #e8e8d3;
}
.keyword.other.special-method {
  color: #b0d0f0;
}
.keyword.other.unit {
  color: #eeeeee;
}
.storage {
  color: #b294bb;
}
.constant {
  color: #eeeeee;
}
.constant.character.escape {
  color: #a40063;
}
.constant.numeric {
  color: #eeeeee;
}
.constant.other.color {
  color: #c6b6fe;
}
.constant.other.symbol {
  color: #7597c6;
}
.variable {
  color: #c6b6fe;
}
.variable.interpolation {
  color: #d62a55;
}
.variable.parameter.function {
  color: #e8e8d3;
}
.invalid.illegal {
  background-color: #de5577;
  color: #151515;
}
.string {
  color: #99ad6a;
}
.string.regexp {
  color: #dd0093;
}
.string.regexp .source.ruby.embedded {
  color: #eeeeee;
}
.string.other.link {
  color: #de5577;
}
.punctuation.definition.comment {
  color: #888888;
}
.punctuation.definition.variable {
  color: #c6b6fe;
}
.punctuation.definition.parameters {
  color: #eeeeee;
}
.punctuation.definition.string,
.punctuation.definition.array {
  color: #556633;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #b0d0f0;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #b294bb;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #d62a55;
}
.support.class {
  color: #f0c674;
}
.support.function {
  color: #c6b6fe;
}
.support.function.any-method {
  color: #b0d0f0;
}
.entity.name.function {
  color: #fad07a;
}
.entity.name.class,
.entity.name.type.class {
  color: #f0c674;
}
.entity.name.section {
  color: #b0d0f0;
}
.entity.name.tag {
  color: #de5577;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #eeeeee;
}
.entity.other.attribute-name.id {
  color: #b0d0f0;
}
.meta.class {
  color: #f0c674;
}
.meta.link {
  color: #eeeeee;
}
.meta.require {
  color: #b0d0f0;
}
.meta.selector {
  color: #b294bb;
}
.meta.separator {
  background-color: #b0b8c0;
  color: #e8e8d3;
}
.none {
  color: #e8e8d3;
}
.markup.bold {
  color: #eeeeee;
  font-style: bold;
}
.markup.changed {
  color: #b294bb;
}
.markup.deleted {
  color: #de5577;
}
.markup.italic {
  color: #b294bb;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #b0d0f0;
}
.markup.inserted {
  color: #99ad6a;
}
.markup.list {
  color: #de5577;
}
.markup.quote {
  color: #eeeeee;
}
.markup.raw.inline {
  color: #99ad6a;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #99ad6a;
}
atom-text-editor[mini] .scroll-view {
  padding-left: 1px;
}
